import React from 'react' //rfc
import { Container, Col, Row } from 'react-bootstrap'
import Button from 'react-bootstrap/Button';

export default function Header() {
    return (
        <Container>
            <Row>
                <Col>
                    <h2 className='text-center'>Dash Boart</h2>
                </Col>
            </Row>
            <Row>
                <Col className='text-center'>
                    <Link>
                        <Button variant="primary" className='mx-2'>Primary</Button>{' '}
                        <Button variant="secondary" className='mx-2'>Secondary</Button>{' '}
                        <Button variant="success" className='mx-2'>Success</Button>{' '}
                        <Button variant="warning" className='mx-2'>Warning</Button>{' '}
                        <Button variant="danger" className='mx-2'>Danger</Button>{' '}
                    </Link>
                </Col>
            </Row>
        </Container>
    )
}
